import { useState } from "react";

function SideNav() {
  const [isOpen, setIsOpen] = useState(false);
  const [sideNavWidth, setSideNavWidth] = useState("3.5rem");

  function openSideNav() {
    setSideNavWidth("200px")
  }

  return (
    <div className="SideNav absolute">
      <nav className={`h-screen bg-yellow-100 w-[${sideNavWidth}] flex flex-col justify-between py-10`}>
        <div className="flex flex-col items-center text-black">
          <a href="#">
            <span className="material-symbols-rounded ">home</span>
          </a>
          <a href="#" className="mt-5">
            <span className="material-symbols-rounded">monitoring</span>{" "}
          </a>
          <a href="#" className="mt-5">
            <span className="material-symbols-rounded">leaderboard</span>
          </a>
        </div>
        <div>
          <a onClick={openSideNav}>
            <span className="material-symbols-rounded text-3xl">exit_to_app</span>
          </a>
        </div>
      </nav>
    </div>
  );
}

export default SideNav;
